  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lacreek Migratory
  Waterfowl Refuge outlines Refuge accomplishments from December of 1937. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game, raptors, and predators- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and plantings. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
